const rounds = [
    {
        title: '3BoulderOnsight',
        data: {
            numBoulders: 3,
            activeTime: 4,
            restTime: 4,
        },
    },
    {
        title: '4BoulderOnsight',
        data: {
            numBoulders: 4,
            activeTime: 4,
            restTime: 4,
        },
    },
    {
        title: '5BoulderOnsight',
        data: {
            numBoulders: 5,
            activeTime: 4,
            restTime: 4,
        },
    },
    {
        title: '6BoulderOnsight',
        data: {
            numBoulders: 6,
            activeTime: 4,
            restTime: 4,
        },
    }
]

function getRound(title) {
    rounds.find(round => {
        if(round.title == title) {
            console.log(title)
            return round
        }
    })
}

console.log(getRound('3BoulderOnsight'))
